import React from 'react';
import { Link } from 'react-router-dom';
import Banner from './Components/Banner/Banner';
import './app.css'

const Home = () => {
    return (
        <div>
            <Banner
                pageTitle={' Abdelbasset BABEKER'}
                subtitle={'Welcom To my Profile Homepage '}
            />
            <br />
            <Link to={'/blogs'}>
                Blogs
            </Link>
            <br />
            <Link to={'/contacts'}>
                Contacts
            </Link>
        </div>
    );
}

export default Home;
